import { Routes, Route } from "react-router-dom";
import Transitions from "./Animation/Transitions";
import Transforms from "./Animation/Transforms";
import Keyframes from "./Animation/Keyframes";
import Loading from "./Animation/Loading";
import Hover from "./Animation/hover";

const Css = () => {
  return (
    <Routes>
      <Route path="/transitions" element={<Transitions />} />
      <Route path="/transforms" element={<Transforms />} />
      <Route path="/Keyframes" element={<Keyframes />} />
      <Route path="/loading" element={<Loading />} />
      <Route path="/hover-effects" element={<Hover />} />
    </Routes>
  );
};

export default Css;
